        $res = jm_is_scalar($val) && jm_is_string($val) && exists $_jm_cst_3{$val};
        if (! $res)
        {
            # .'$Model#Model'.'|'.0
            $res = !defined($val);
            if (! $res)
            {
                # .'$Model#Model'.'|'.1
                $res = jm_is_boolean($val) && $val == 1;
                if (! $res)
                {
                    # .'$Model#Model'.'|'.2
                    $res = jm_is_integer($val) && $val == 0;
                    if (! $res)
                    {
                        # .'$Model#Model'.'|'.3
                        $res = jm_is_integer($val) && $val == 1;
                        if (! $res)
                        {
                            # .'$Model#Model'.'|'.4
                            $res = jm_is_integer($val) && $val == -1;
                            if (! $res)
                            {
                                # .'$Model#Model'.'|'.5
                                $res = jm_is_numeric($val) && $val == 0.0;
                                if (! $res)
                                {
                                    # .'$Model#Model'.'|'.6
                                    $res = jm_is_numeric($val) && $val == 1.0;
                                    if (! $res)
                                    {
                                        # .'$Model#Model'.'|'.7
                                        $res = jm_is_numeric($val) && $val == -1.0;
                                        if (! $res)
                                        {
                                            # .'$Model#Model'.'|'.8
                                            $res = json_model_11($val, $path, $rep);
                                            if (! $res)
                                            {
                                                # .'$Model#Model'.'|'.9
                                                $res = json_model_10($val, $path, $rep);
                                                if (! $res)
                                                {
                                                    # .'$Model#Model'.'|'.10
                                                    # "/^/($EXREG)/[a-z]*X[a-z]*$/X"
                                                    $res = jm_is_string($val) && _jm_xre_1($val, $path, $rep);
                                                    if (! $res)
                                                    {
                                                        # .'$Model#Model'.'|'.11
                                                        # "/^/($REGEX)/[a-z]*$/X"
                                                        $res = jm_is_string($val) && _jm_xre_0($val, $path, $rep);
                                                        if (! $res)
                                                        {
                                                            # .'$Model#Model'.'|'.12
                                                            $res = json_model_9($val, $path, $rep);
                                                            if (! $res)
                                                            {
                                                                # .'$Model#Model'.'|'.13
                                                                $res = json_model_20($val, $path, $rep);
                                                            }
                                                        }
                                                    }
                                                }
                                            }
                                        }
                                    }
                                }
                            }
                        }
                    }
                }
            }
        }
    }
    return $res;
}


